import React from 'react';

function Services(): JSX.Element {
  return (
    <div className="max-w-7xl mx-auto py-16 px-4 sm:px-6 lg:px-8 fade-in">
      <h1 className="text-3xl font-bold mb-4">Our Services</h1>
      <ul className="list-disc pl-5 text-gray-700 space-y-2">
        <li>Vehicle sourcing and procurement</li>
        <li>Restoration and maintenance</li>
        <li>Personalized delivery and logistics</li>
        <li>Financing support and appraisal</li>
      </ul>
    </div>
  );
}

export default Services;
